import logo from "./logo.svg";
import "./App.css";
import { Data } from "./components/Data";

import { BrowserRouter as Router, Routes, Route } from "react-router-dom";

// import { store } from "./store";
// import { Provider } from "react-redux";
// import { ApiProvider } from "@reduxjs/toolkit/query/react";
// import { psetsApi } from "./features/apiSlice";
import Header from "./components/Navbar";
import PageNotFound from "./components/PageNotFound";
// import Home from "./components/Home";
// import Home from "./components/JS";
// import Home from "./components/search";

import Home from "./components/Home";
import Dbrecord from "./components/DB";

// import Home from "./pages/home";

function App() {
  return (
    // <div className="App">
    //   <OffcanvasExample />
    // </div>

    <div className="app">
      <Router>
        <Header></Header>

        <Routes>
          <Route path="/" element={<Home />} />
          <Route path="/psets-database" component={Dbrecord} />
          <Route path="*" element={<PageNotFound />} />
        </Routes>
      </Router>
    </div>

    // <Provider store={store}>
    //   <ApiProvider api={psetsApi}>
    //     <div className="App">
    //       <Data />
    //       <ToastContainer />
    //       <NavBar />
    //       <div className="content-container"></div>
    //     </div>
    //   </ApiProvider>
    // </Provider>
  );
}

export default App;
